import {SET_CURRENT_USER , GOOGLE_SIGNIN_START,GOOGLE_SIGNIN_SUCCESS,GOOGLE_SIGNIN_FAILED ,EMAIL_SIGNIN_START,EMAIL_SIGNIN_SUCCESS,EMAIL_SIGNIN_FAILED} from '../../types/types'

export const setCurrentUser = user => ({
    type : SET_CURRENT_USER,
    data : user
})

export const googleSigninStart = () => ({
    type : GOOGLE_SIGNIN_START
})


export const googleSigninSuccess = user => ({
    type : GOOGLE_SIGNIN_SUCCESS,
    data : user
})

export const googleSigninFailed = errorMessage => ({
    type : GOOGLE_SIGNIN_FAILED,
    data : errorMessage
})

export const emailSigninStart = (emailAndPassword) => ({
    type : EMAIL_SIGNIN_START,
    data : emailAndPassword
})

export const emailSigninSuccess = user => ({
    type : EMAIL_SIGNIN_SUCCESS,
    data : user
})

export const emailSigninFailed = errorMessage => ({
    type : EMAIL_SIGNIN_FAILED,
    data : errorMessage
})
